    }

    function styleForKey(key) {
      const arr = sharesByKey[key];
      return function(feature) {
        const id = feature.properties.gid;
        const s = arr[id];
        return {
          fillColor: (s === undefined || s === null) ? '#dddddd' : colorRamp(s),
          color: '#666', weight: 0.2, fillOpacity: 0.65
        };
      }
    }

    function snapKey(val, keys) {
      const f = parseFloat(val);
      let best = keys[0];
      let bestDist = Math.abs(parseFloat(best) - f);
      for (const k of keys) {
        const d = Math.abs(parseFloat(k) - f);
        if (d < bestDist) { bestDist = d; best = k; }
      }
      return best;
    }

    const map = L.map('map').setView([gLat, gLon], 13);
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
      maxZoom: 19, attribution: '&copy; OpenStreetMap contributors'
    }).addTo(map);

    L.marker([gLat, gLon]).addTo(map).bindPopup("g (historic center)");

    let muMarker = L.circleMarker([0,0], {
      radius: 7, weight: 2, color: '#000', fillColor: '#fff', fillOpacity: 1
    }).addTo(map).bindPopup("Î¼ (economic center)");

    let gridLayer = L.geoJSON(gridGeojson, {
      style: styleForKey("1.00_1.00"),
      onEachFeature: function(feature, layer) {
        layer.on('mouseover', function() {
          const tVal = document.getElementById('tSlider').value;
          const aVal = document.getElementById('aSlider').value;
          const tk = snapKey(tVal, tKeys);
          const ak = snapKey(aVal, aKeys);
          const key = tk + "_" + ak;
          const id = feature.properties.gid;
          const s = sharesByKey[key][id];
          layer.bindTooltip(`gid: ${id}<br>share: ${s}`, {sticky:true}).openTooltip();
        });
      }
    }).addTo(map);

    const legend = L.control({position:'bottomright'});
    legend.onAdd = function() {
      const div = L.DomUtil.create('div', 'legend');
      div.innerHTML = `
        <div><b>Business share</b></div>
        <div style="display:flex;align-items:center;gap:8px;margin-top:6px;">
          <span style="width:16px;height:16px;background:${colorRamp(0)};display:inline-block;"></span> 0
          <span style="width:16px;height:16px;background:${colorRamp(0.5)};display:inline-block;margin-left:10px;"></span> 0.5
          <span style="width:16px;height:16px;background:${colorRamp(1)};display:inline-block;margin-left:10px;"></span> 1
        </div>
      `;
      return div;
    };
    legend.addTo(map);

    function update() {
      const tVal = document.getElementById('tSlider').value;
      const aVal = document.getElementById('aSlider').value;

      const tk = snapKey(tVal, tKeys);
      const ak = snapKey(aVal, aKeys);
      const key = tk + "_" + ak;

      document.getElementById('tVal').textContent = parseFloat(tVal).toFixed(2);
      document.getElementById('aVal').textContent = parseFloat(aVal).toFixed(2);
      document.getElementById('tSnap').textContent = `snap: ${tk}`;
      document.getElementById('aSnap').textContent = `snap: ${ak}`;

      gridLayer.setStyle(styleForKey(key));

      const mu = muByKey[key];
      muMarker.setLatLng([mu.lat, mu.lon]);

      document.getElementById('muInfo').textContent =
        `(${mu.lon.toFixed(5)}, ${mu.lat.toFixed(5)})  | key: ${key}`;
    }

    document.getElementById('tSlider').addEventListener('input', update);
    document.getElementById('aSlider').addEventListener('input', update);
    update();
  </script>
</body>
</html>
